Defendant in custody.   
State moves to delete the penalty enhancers on count 3 and count 5.   Motion granted.  
Count 3 - Deliver Methamphetamine - Guilty plea.  
Count 5 - Possess Methamphetamine with Intent to Deliver - Guilty plea.   Convicted.   State moves to dismiss and read in counts 1, 2, and 4.   Motion granted.   
Defendant is sentenced to the Wisconsin State Prison System for a total sentence of eight and one-half (8 1/2) years.  Three and one-half (3 1/2) years initial confinment followed by five (5) years extended supervision.   Conditions of extended supervision are:
1) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
2) Submit to random urine screens and pay for same;
3) Maintain full-time employment or school or combination or participate in a work search if unemployed; 
4) Pay $450.00 buy money to Manitowoc Metro Drug Unit as restitution; 
5) Participate in any assessments or counseling the DOC deems appropriate;
6) Submit DNA sample and pay surcharge;
7) Pay costs of the action; 
8) Pay supervision fees in an amount to be determined by DOC.  
Court finds defendant is eligible for the Challenge Incarceration Program and the Substance Abuse Program.  Defendant is given credt for 106 days time already served.   
